pragma solidity ^0.5.0;

import "./ownable.sol";

contract UserFactory is Ownable {

  event NewUser(uint userId, string name, string phoneNumber);
  event NewHouse(uint houseId, string imageUrl, string location, uint32 price);

  struct User {
    string userName;
    string phoneNumber;
  }

  struct House {
    string imageUrl;
    string location;
    uint32 price;
  }

  User[] public users;
  House[] public houses;

  // user -> owner
  mapping (uint => address) public userToOwner;
  // house -> owner
  mapping (uint => address) public houseToOwner;
  // house -> renter(can be null)
  mapping (uint => address) public houseToRenter;
  // 0/1: the house is rented / not rented
  mapping (uint => uint) public isHouseRented;
  // owner -> the amount of users owner has
  mapping (address => uint) ownerUserCount;
  // owner -> the amount of houses owner has
  mapping (address => uint) ownerHouseCount;
  // renter -> the amount of houses renter rents
  mapping (address => uint) renterHouseCount;
  // owner -> the amount of money owner has
  mapping (address => uint) ownerMoneyCount;

  constructor() public {
    ownerMoneyCount[msg.sender] = 100000;
  }
  /*
    Set information for new user
  */
  function createUser(string calldata _name, string calldata _phoneNumber) external {
    //require(ownerUserCount[msg.sender] == 0);
    uint id = users.push(User(_name, _phoneNumber)) - 1;
    userToOwner[id] = msg.sender;
    ownerUserCount[msg.sender]++;
    emit NewUser(id, _name, _phoneNumber);
 }

  /*
    msg.sender add a new house
  */
  function addHouse(string calldata _imageUrl, string calldata _location, uint32 _price) external {
    uint id = houses.push(House(_imageUrl, _location, _price)) - 1;
    houseToOwner[id] = msg.sender;
    ownerHouseCount[msg.sender]++;
    isHouseRented[id] = 0;
    emit NewHouse(id, _imageUrl, _location, _price);
  }

}
